import palette from "../../utils/styles";

const ItemList = styled.div`
  border: 1px solid red;
  display: flex;
`;

const Number = styled.div`
  color: black;
  font-weight: bold;
  margin-right: 10px;
  background: coral;
`;

const Word = styled.div`
  margin-right: 10px;
`;

const Meaning = styled.div`
  margin-right: 10px;
`;

